But every now and then... you are reminded that though they seem so very grown, 6 years is seriously NOT such a long time... and this year? This year has been like moving through the thickest stickiest molasses. Flashes of our baby come and go, a little more often lately. 

While it triggers my anxiety, knowing that if life were different she would be more big little girl than baby, I feel like I must find a way to capture these moments where we are reminded that she is still small, still desperately needing us, even while trying to shove us away at every turn.

Parenting is all kinds of magic, but it is also every level of hard. And parenting in a pandemic is so far beyond that, there really aren‚Äôt sufficient words to describe it.

